BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS `users_room_votes` (
	`user_id`	INTEGER NOT NULL,
	`room_id`	INTEGER NOT NULL,
	`vote`	INTEGER NOT NULL
);
CREATE TABLE IF NOT EXISTS `users_room_favourites` (
	`room_id`	INTEGER NOT NULL,
	`user_id`	INTEGER NOT NULL
);
CREATE TABLE IF NOT EXISTS `users_badges` (
	`user_id`	INTEGER NOT NULL,
	`badge`	INTEGER NOT NULL
);
CREATE TABLE IF NOT EXISTS `users` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`username`	TEXT NOT NULL,
	`password`	TEXT NOT NULL,
	`figure`	TEXT NOT NULL,
	`pool_figure`	TEXT NOT NULL,
	`sex`	TEXT NOT NULL DEFAULT 'M',
	`motto`	TEXT NOT NULL DEFAULT 'de kepler whey',
	`credits`	INTEGER NOT NULL DEFAULT 200,
	`tickets`	INTEGER NOT NULL DEFAULT 0,
	`film`	INTEGER NOT NULL DEFAULT 0,
	`rank`	INTEGER NOT NULL DEFAULT 1,
	`console_motto`	TEXT NOT NULL DEFAULT 'I''m a new user!',
	`last_online`	INTEGER NOT NULL DEFAULT 0,
	`sso_ticket`	TEXT,
	`club_subscribed`	INTEGER NOT NULL DEFAULT 0,
	`club_expiration`	INTEGER NOT NULL DEFAULT 0,
	`badge`	TEXT NOT NULL,
	`badge_active`	INTEGER NOT NULL DEFAULT 0
);
CREATE TABLE IF NOT EXISTS `rooms_rights` (
	`room_id`	INTEGER NOT NULL,
	`user_id`	INTEGER NOT NULL
);
CREATE TABLE IF NOT EXISTS `rooms_models` (
	`model_id`	TEXT NOT NULL,
	`model_name`	TEXT,
	`door_x`	INTEGER NOT NULL DEFAULT '0',
	`door_y`	INTEGER NOT NULL DEFAULT '0',
	`door_z`	REAL NOT NULL,
	`door_dir`	INT DEFAULT 2,
	`heightmap`	TEXT NOT NULL,
	`usertype`	INT NOT NULL DEFAULT '1'
);
CREATE TABLE IF NOT EXISTS `rooms_categories` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`order_id`	INTEGER NOT NULL,
	`parent_id`	INTEGER NOT NULL,
	`isnode`	INTEGER NOT NULL DEFAULT 0,
	`name`	TEXT NOT NULL,
