	`allow_trading`	INTEGER NOT NULL DEFAULT 0,
	`minrole_access`	INTEGER NOT NULL DEFAULT 1,
	`minrole_setflatcat`	INTEGER NOT NULL DEFAULT 1
);
CREATE TABLE IF NOT EXISTS `rooms` (
	`id`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`owner_id`	int ( 11 ) NOT NULL,
	`category`	int ( 3 ) NOT NULL DEFAULT '0',
	`name`	TEXT NOT NULL,
	`description`	TEXT NOT NULL,
	`model`	TEXT NOT NULL,
	`ccts`	TEXT DEFAULT NULL,
	`wallpaper`	int ( 4 ) NOT NULL DEFAULT '0',
	`floor`	int ( 4 ) NOT NULL DEFAULT '0',
	`showname`	INT ( 1 ) NOT NULL DEFAULT 1,
	`superusers`	INT ( 1 ) NOT NULL DEFAULT 0,
	`accesstype`	INT ( 0 ) NOT NULL DEFAULT 0,
	`password`	TEXT NOT NULL,
	`visitors_now`	int ( 3 ) NOT NULL DEFAULT '0',
	`visitors_max`	int ( 3 ) NOT NULL DEFAULT '25'
);
CREATE TABLE IF NOT EXISTS `rank_fuserights` (
	`min_rank`	INTEGER NOT NULL,
	`fuseright`	TEXT NOT NULL
);
CREATE TABLE IF NOT EXISTS `messenger_requests` (
	`from_id`	INTEGER,
	`to_id`	INTEGER
);
CREATE TABLE IF NOT EXISTS `messenger_messages` (
	`id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`receiver_id`	INTEGER NOT NULL,
	`sender_id`	INTEGER NOT NULL,
	`unread`	TEXT NOT NULL,
	`body`	TEXT NOT NULL,
	`date`	TEXT NOT NULL
);
CREATE TABLE IF NOT EXISTS `messenger_friends` (
	`from_id`	INTEGER,
	`to_id`	INTEGER
);
CREATE TABLE IF NOT EXISTS `items_definitions` (
	`id`	INTEGER,
	`cast_directory`	TEXT,
	`sprite`	TEXT,
	`colour`	TEXT,
	`length`	INTEGER,
	`width`	INTEGER,
	`top_height`	NUMERIC,
	`behaviour`	TEXT
);
CREATE TABLE IF NOT EXISTS `items` (
	`id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`user_id`	INTEGER,
	`room_id`	INTEGER,
	`definition_id`	INTEGER,
	`x`	TEXT,
	`y`	TEXT,
	`z`	NUMERIC,
	`wall_position`	TEXT,
	`rotation`	INTEGER,
	`custom_data`	TEXT
);
CREATE TABLE IF NOT EXISTS `catalogue_pages` (
	`id`	INTEGER,
	`order_id`	INTEGER,
	`min_role`	INTEGER,
	`name_index`	TEXT,
	`name`	TEXT,
	`layout`	TEXT,
	`image_headline`	TEXT,
	`image_teasers`	TEXT,
	`body`	TEXT,
	`label_pick`	TEXT,
	`label_extra_s`	TEXT,
	`label_extra_t`	TEXT
);
