CREATE TABLE IF NOT EXISTS `catalogue_packages` (
	`salecode`	TEXT,
	`definition_id`	INTEGER,
	`special_sprite_id`	INTEGER,
	`amount`	INTEGER
);
CREATE TABLE IF NOT EXISTS `catalogue_items` (
	`sale_code`	TEXT,
	`page_id`	INTEGER,
	`order_id`	INTEGER,
	`price`	INTEGER,
	`definition_id`	INTEGER,
	`item_specialspriteid`	INTEGER,
	`package_name`	TEXT,
	`package_description`	TEXT,
	`is_package`	INTEGER
